import { typedAction } from "./types";
import { SET_WIDTH_FILTER } from "./actionTypes";

const initialState = {
  width: "",
};

export default function filterReducer(state = initialState, action) {
  switch (action.type) {
    case SET_WIDTH_FILTER:
      return state;
    default:
      return state;
  }
}
